    <script>
        let isMobile = /iPhone|iPad|iPod|Android/i.test(navigator.userAgent);
        if (!isMobile) { //assume debugger utility below is only when running on PC
        }
        else {
            // reset viewport of mobile devices to default for consistency between platforms
            var metaTag = document.querySelector('meta[name=viewport]');
            if (!metaTag) {
                metaTag = document.createElement('meta');
                metaTag.name = "viewport";
                metaTag.content = "width=device-width, initial-scale=1.0";
                document.getElementsByTagName('head')[0].prepend(metaTag);
            }
            else {
                metaTag.content = "width=device-width, initial-scale=1.0";
            }
            //Below is necessary because Android does not start at full screen
            //doesn't runn on PC, so we can use the screen resizing for some format checks
            document.documentElement.style.height = document.documentElement.clientHeight + 'px';
        }
    </script>

    <style>
        body {
            background-color: #40404080;
        }

        .main, .submain, .progressCircle {
            width: 90%;
            height: 90%;
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            /*font: 100% Verdanapx;*/
            font-size: 100%;
            line-height: 1.2em;
            -moz-border-radius: 10px;
            -webkit-border-radius: 10px;
            border-radius: 10px;
            background: #fff;
            background: -moz-linear-gradient(#fff, #ccc);
            background: -webkit-linear-gradient(#fff, #ccc);
            background: -o-linear-gradient(#fff, #ccc);
            box-shadow: 0 0 10px #000;
            -moz-box-shadow: 0 0 10px #000;
            -webkit-box-shadow: 0 0 10px #000;
        }

        .submain, .progressCircle {
            display: none;
            z-index: 2;
            width: max-content;
            max-width: 100%;
            height: max-content;
            max-height: 90%;
            top: 40%;
        }

        /*.submain:has(> .adjustScaleForm.enabled, .adjustScaleFormConfirmation.enabled, .adjustScaleFormWarning.enabled) {*/
        /*    display: block;*/
        /*}*/

        .popupButton.close {
            position: absolute;
            z-index: 9999;
            cursor: pointer;
            background: rgba(96, 96, 96, 0.90);
            color: #FFFFFF;
            text-align: center;
            right: -12px;
            top: -12px;
            height: 2rem;
            width: 2rem;
            text-decoration: none;
            font-weight: bold;
            -webkit-border-radius: 2rem;
            -moz-border-radius: 2rem;
            border-radius: 1rem;
            border: none;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
            -moz-box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
            -webkit-box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
        }

        .close:active,
        .close:focus {
            background: rgba(255, 0, 0, 1);
            -moz-transition: all 0.5s ease-out;
            -webkit-transition: all 0.5s ease-out;
            -o-transition: all 0.5s ease-out;
            transition: all 0.5s ease-out;
        }

        .readOnlyParams {
            /*display: flex;*/
            /*flex-direction: column;*/
            margin: 10px;
            /*font-size: 1em;*/
        }

            .readOnlyParams > div > label {
                font-weight: bold;
            }

        .form {
            text-align: center;
            padding: 5px;
        }

        .adjustScaleForm, .adjustScaleFormConfirmation, .adjustScaleFormWarning {
            display: none;
            text-align: center;
            /*width: fit-content;*/
            /*height: fit-content;*/
            padding: 5px;
            /*max-height: 90%;*/
            /*max-width: 90%;*/
            overflow-y: auto;
        }

        .submain.enabled, .submain > .enabled {
            display: block;
        }

        label {
            margin-bottom: 10px;
        }

        .adjustScaleInstructions {
            height: 100%;
            width: 100%;
        }

        /*.adjustScaleWarning:has(+.adjustScaleDisable:disabled) {*/
        .adjustScaleError {
            color: #f44336;
        }

        .adjustScaleDisable:disabled {
            display: none;
        }

        .adjustScaleFormInput {
            /*padding: 5px;*/
            border: 1px solid #ccc;
            border-radius: 4px;
            box-sizing: border-box;
            margin: 5px;
            width: 17em;
            /*font-size: 1em;*/
            resize: vertical;
        }

            .adjustScaleFormInput::-webkit-input-placeholder,
            .adjustScaleFormInput::-moz-placeholder,
            .adjustScaleFormInput:-ms-input-placeholder {
                color: #999999; /* light grey color */
            }

            .adjustScaleFormInput:focus::-webkit-input-placeholder,
            .adjustScaleFormInput:focus::-moz-placeholder,
            .adjustScaleFormInput:focus:-ms-input-placeholder {
                color: transparent; /* make the placeholder text disappear when in focus */
            }

        .adjustScaleFormButtons {
            text-align: center;
            text-align: -webkit-center;
            margin: 5px;
        }

        .formButton {
            color: white;
            padding: 10px;
            border: none;
            border-radius: 4px;
            cursor: pointer;
            font-size: 1em;
            min-width: 5em;
        }

            .formButton.green {
                background: #4CAF50;
            }

            .formButton.grey {
                background: #606060;
            }

            .formButton.revealAdjustScaleForm {
                visibility: hidden;
            }

        .slideshow-container {
            position: relative;
            /*display: flex;*/
            /*flex-direction: column;*/
            height: 80%;
            margin: auto;
            overflow-y: auto;
            overflow-x: hidden;
        }

        .instructions-slide {
            text-align: -webkit-center;
            text-align: center;
            position: absolute;
            height: 60%;
            width: 100%;
            transition: transform 1s ease-in-out;
            -webkit-animation-name: fadeIn;
            -webkit-animation-duration: 1s;
            -webkit-animation-fill-mode: both;
            animation-name: fadeIn;
            animation-duration: 1s;
            animation-fill-mode: both;
            transform: translateX(0%);
        }

            .instructions-slide.left, .instructions-slide.right {
                transition: transform 1s ease-in-out;
                -webkit-animation-name: fadeOut;
                -webkit-animation-duration: 1s;
                -webkit-animation-fill-mode: both;
                animation-name: fadeOut;
                animation-duration: 1s;
                animation-fill-mode: both;
            }

            .instructions-slide.left {
                transform: translateX(-100%);
            }

            .instructions-slide.right {
                transform: translateX(100%);
            }

        @keyframes fadeOut {
            from {
                opacity: 1;
            }

            to {
                opacity: 0;
            }
        }

        @keyframes fadeIn {
            from {
                opacity: 0;
            }

            to {
                opacity: 1;
            }
        }

        @keyframes blink {
            from {
                opacity: 0.5;
            }

            to {
                opacity: 1;
            }
        }

        @media screen and (max-width: 600px) {
            .prev, .next {
                font-size: 1rem
            }
        }

        .slide-navigation {
            cursor: pointer;
            z-index: 1;
            position: absolute;
            background: rgba(96, 96, 96, 0.80);
            top: 50%;
            /*bottom: 0;*/
            margin: auto;
            /*width: 3rem;*/
            /*height: 3rem;*/
            line-height: 3rem;
            padding: 5px;
            color: #FFFFFF;
            text-align: center;
            font-weight: bold;
            transition: 0.6s ease;
            border-radius: 6px 6px 6px 6px;
            user-select: none;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.67);
            -moz-box-shadow: 0 0 10px rgba(0, 0, 0, 0.58);
            -webkit-box-shadow: 0 0 10px rgba(0, 0, 0, 0.63);
        }

            .slide-navigation:disabled {
                cursor: not-allowed;
            }

            .slide-navigation.prev {
                left: -1.5rem;
            }

            .slide-navigation.next {
                right: -1.5rem;
            }

        .prev:active, .next:active,
        .prev:focus, .next:focus {
            background: rgba(0, 217, 255, 0.40);
            -moz-transition: all 0.5s ease-out;
            -webkit-transition: all 0.5s ease-out;
            -o-transition: all 0.5s ease-out;
            transition: all 0.5s ease-out;
        }

        .dot {
            cursor: pointer;
            height: 0.5rem;
            width: 0.5rem;
            margin: 0 2px;
            background-color: #bbb;
            border-radius: 50%;
            display: inline-block;
            transition: background-color 0.6s ease;
        }

            .dot.active, .dot:hover {
                background-color: #717171;
            }

        .dots, .instructions-slide-description {
            position: relative;
            text-align: -webkit-center;
            text-align: center;
            margin: 0.5rem;
            top: 60%;
            left: 0;
            right: 0;
            /*font-size: larger;*/
            /*transform: translateY(-100%);*/
        }

        .readParam {
            border: None;
            outline: None;
            background-color: transparent;
            width: fit-content;
        }

        /* Designing for scroll-bar */
        ::-webkit-scrollbar {
            width: 6px;
        }

        /* Track */
        ::-webkit-scrollbar-track {
            background: gainsboro;
            border-radius: 5px;
        }

        /* Handle */
        ::-webkit-scrollbar-thumb {
            background: #717171;
            border-radius: 5px;
        }

        .adjustScaleLoading {
            position: absolute;
            top: 50%;
            transform: translateY(-50%);
            left: 0;
            right: 0;
            text-align: -webkit-center;
            text-align: center;
        }

        canvas {
            border: 0px solid #d3d3d3;
            background-size: contain;
            background-repeat: no-repeat;
            background-position: center;
            max-width: 100%;
            max-height: 100%;
            width: 100%;
            height: 100%;
        }

<body>
<div class="main">
    <!--    <button class="popupButton close">X</button>-->
    <div class="adjustScaleLoading adjustScaleDisable">
        <canvas id="myCanvas"></canvas>
        <p class="loadingText"></p>
        <div class="adjustScaleFormButtons" style="display: none">
            <button class="formButton green" type="button" onclick="revealAdjustScaleInstructions(true)">Next</button>
        </div>
    </div>
    <div class="adjustScaleError adjustScaleDisable" style="display: none">
        <img class="icon-error" alt="Icon Error" draggable="true"/>
        <p class="warningText"></p>
        <div class="adjustScaleFormButtons">
            <button class="formButton grey close" type="button">Cancel</button>
        </div>
    </div>
    <div class="adjustScaleInstructions adjustScaleDisable" style="display: none">
        <div class="slideshow-container">
            <div class="instructions-slide">
                <canvas class="volt-meter">Step 2 of 3:<br>You will need an accurate digital multimeter to measure the voltage.</canvas>
            </div>
            <div class="instructions-slide right">
                <canvas class="battery-post-location">Step 3 of 3:<br>Measure battery voltage across the positive and negative terminals.
                    <br>Click 'Calibrate' button below when ready.</canvas>
            </div>
            <div class="dots">
                <span class="dot"></span>
                <span class="dot"></span>
            </div>
            <p class="instructions-slide-description"></p>
        </div>
        <div class="slide-navigation prev">&#10094; Prev</div>
        <div class="slide-navigation next">Next &#10095;</div>
        <div class="readOnlyParams">
            <div>
                <label for="LOGICSIDEBATTERYVOLTAGEV-value"></label>
                <span id="LOGICSIDEBATTERYVOLTAGEV-value" class="readParam decimal=2 concat=V"></span>
            </div>
        </div>
        <div class="adjustScaleFormButtons">
            <button class="formButton green revealAdjustScaleForm" type="button" onclick="revealAdjustScaleForm(true)">
                Calibrate
            </button>
            <button class="formButton grey close" type="button">Cancel</button>
        </div>
    </div>
    <div class="submain">

            <b>Description:</b>(Images:TAC2_EZGO_RXV23.png,TAC2_EZGO_RXV35.png)(ImageOverlays:_throttle_footsw.png)
             The accelerator pedal under the floor board contains two circuits, one is this analog sensor where:
            <br><b>•</b> the below voltage thresholds are default programmable values, not usually changed but accessible through the throttle calibration routine.
            <br><b>•</b> below 1.5V pedal is usually fully off
            <br><b>•</b> above 3.7V is fully on
            <br><b>•</b> between 1.5V and 3.7V determines how hard the pedal is pressed.
            <br><b>•</b> See Foot Switch for second circuit.
            <br>
            <br><b>On:</b> above 1.5V
            <br><b>Not Pressed:</b> below 1.5V
            <br><b>Disconnected:</b> around 1.6V
            <br>Troubleshooting Notes:
            <br><b>1.</b> If the dashboard green words indicate "waiting for throttle" and you are pressing on the throttle then this signal is preventing the vehicle from driving.
            <br><b>2.</b> Press the pedal and read the input in the Diagnostics Tab. If it is connected then the voltage will change and we need to check the voltage vs the throttle settings (double tap the actaul volage reading above to check the settings)
            <br><b>3.</b> If it is not connected then this input should read around 1.6V and you should check the vehicle harness
            <br><b>4.</b> If there is no change in voltage and you should check the vehicle harness.
            <br><b>5.</b> To troubleshoot, IT IS BEST TO LIFT THE DRIVING WHEELS OFF THE GROUND, IF THE VEHICLE IS NOT IN NEUTRAL AND THESE SIGNALS BEGIN TO PARTIALLY WORK THE VEHICLE MAY MOVE.
            <br><b>6.</b> Checking the vehicle harness:
            <br><b>a)</b> Since this input needs to be connected to the controller to be powered by 5V you will have to disconnect the the 3 wire connector in the throttle assembly in the floor.
            <br><b>b)</b> With a meter measure that the 5V supply from the controller is on the 5V wire.
            <br><b>c)</b> The signal wire should measure 1.6V since the throttle is disconnected.
            <br><b>d)</b> measure that there is continuity to Battery Ground on the ground wire.

            <b>Description:</b>(Images:TAC2_EZGO_RXV23.png,TAC2_EZGO_RXV35.png)(ImageOverlays:_throttle_footsw.png)
             This input is one of two signals coming from the accelerator pedal. It is for redundant safety to ensure the accelerator pedal is functional. It must turn on before the controller uses the throttle voltage to drive.
            <br><b>•</b> This input is switched to battery voltage when the throttle is slightly pressed and before the throttle reaches the its on voltage.
            <br><b>•</b> The vehicle will not move if this signal is always on after power up or is off but the throttle voltage is on.
            <br><b>•</b> See Throttle Voltage for second circuit.
            <br>
            <br><b>On:</b> battery voltage
            <br><b>Off:</b> no connection, pulled to 0V internally
            <br>Troubleshooting Notes:
            <br><b>1.</b> If the dashboard green words indicate "waiting for foot switch" then this signal is preventing the vehicle from driving.
            <br><b>2.</b> If the dashboard green words indicate "waiting for foot switch to release" then this signal is preventing the vehicle from driving.
            <br><b>3.</b> Press the pedal and read the input in the Diagnostics Tab.
            <br><b>4.</b> To troubleshoot, IT IS BEST TO LIFT THE DRIVING WHEELS OFF THE GROUND, IF THE VEHICLE IS NOT IN NEUTRAL AND THESE SIGNALS BEGIN TO PARTIALLY WORK THE VEHICLE MAY MOVE.
            <br><b>5.</b> Checking the vehicle harness:
            <br><b>a)</b> REMEBER TO TURN VEHICLE POWER OFF before connecting or disconnecting the harness (switch Key off)
            <br><b>b)</b> Disconnect the vehicle harness from the controller.
            <br><b>c)</b> With one side of a meter connected to the battery pack ground, measure that this pin on the vehicle harness has battery voltage when the accelerator pedal pressed and 0V when released.
            <br><b>d)</b> if c) fails open the throttle assembly under the accelerator pedal and verify the other side of the foot switch has battery voltage.
            <br><b>e)</b> Verify this switch closes when actuated.

        <Name>Encoder B</Name>
        <Description>
            <![CDATA[
            <b>Description:</b>This vehicle has two inputs to determine motor speed. The controller provides 5V and ground to the motor speed sensor and reads back two signals, A and B which change between 0 and 5V at a rate and sequence depending on vehicle speed. They will typically change hundreds of times for one revolution of the motor.
            <br>
            <br><b>High:</b> 5V
            <br><b>Low:</b> 0V
            <br><b>Disconnected:</b> pulled to 5V internally ie., Always reading Not Changing (High).
            <br><b>Fault:</b> Not changing when motor has significant driving current

            <br>Troubleshooting Notes:
            <br><b>1.</b> Very small movement of the vehicle should shows these inputs Changing High and Low.
            <br><b>2.</b> After absolutely no movement for 5 seconds they will show Not Changing at whatever level they are at.
            <br><b>3.</b> If the motor has plenty of current to move and one or both of these signals are broken the motor may move very slowly until a fault occurs.
            <br><b>4.</b> To troubleshoot, IT IS BEST TO LIFT THE DRIVING WHEELS OFF THE GROUND, IF THE VEHICLE IS NOT IN NEUTRAL AND THESE SIGNAL ONLY PARTIALLY WORK THE VEHICLE MAY MOVE.
            <br><b>5.</b> With the vehicle in neutral these signals still function
            <br><b>6.</b> Checking the vehicle harness:
            <br><b>a)</b> Since these inputs need to be connected to the controller to be powered by 5V you will have to disconnect the 5 wire harness close to the Motor.
            <br><b>b)</b> With a meter measure that the 5V supply from the controller is on the 5V wire.
            <br><b>c)</b> The signals wires should measure 5V if the speed sensor is disconnected.
            <br><b>d)</b> measure that there is continuity to Battery Ground on the ground wire.
            <br><b>e)</b> if you can access the signals while plugged in to the controller then you should see them change from 0 to 5V while slightly moving the wheels.
        ]]>
        </Description>
    </GoiParameter>

        <Name>Brake Switch</Name>
        <Description>
            <![CDATA[
            Binding:PARPROFILENUMBER.enumListName(EZGO_RXV_440A,EZGO_RXV_600A,EZGO_RXV2016_440A,EZGO_RXV2016_600A,RXV_ELITE_LITHIUM_600A)
            <b>Description:</b>(Images:TAC2_EZGO_RXV23.png,TAC2_EZGO_RXV35.png)(ImageOverlays:_brake_brakesw.png)
            A normally closed switch in the brake pedal assembly which opens and forces the parking/emergency brake in the motor to engage COMPLETELY.
            <br><b>•</b> We cannot read this on a Danaher 23 PIN VEHICLE HARNESSES so it will say Off but it is connected to the actual brake.
            <br><b>•</b> on a 35 pin Curtis vehicle harness it is connected to the controller and indicates when the brake pedal has been fully pressed to the floor.
            <br><b>•</b> This wire is also connected directly to one side of the parking brake solenoid to power it. If this switch is open then this 48V is disconnected from the actual brake and the brake engages immediately whether or not the controller drives the Electric parking brake disengage output
            <br>
            <br><b>On:</b> battery voltage
            <br><b>Off:</b> no connection, pulled to 0V internally
            <br>Troubleshooting Notes:
            <br><b>1.</b> The controller does not do anything with this input but if your brake is never disengaging (see run/tow switch for help)
            <br><b>4.</b> Checking the vehicle harness:
            <br><b>a)</b> REMEBER TO TURN VEHICLE POWER OFF before connecting or disconnecting the harness (switch Key off)
            <br><b>b)</b> open the brake assembly under the brake pedal and verify the other side of the brake switch has battery voltage.
            <br><b>e)</b> Verify this switch closes when actuated.

            <b>Description:</b> This whole section will not show up if connected to an actual vehicle and the analog brake is not enabled
        ]]>
        </Description>

        <Name>Key In</Name>
        <Description>
            <![CDATA[
            Binding:PARPROFILENUMBER.enumListName(EZGO_RXV_440A,EZGO_RXV_600A,EZGO_RXV2016_440A,EZGO_RXV2016_600A,RXV_ELITE_LITHIUM_600A)
            <br><b>Description:</b>(Images:TAC2_EZGO_RXV23.png,TAC2_EZGO_RXV35.png)(ImageOverlays:_key_run_charge.png)
             On this vehicle the key is the low current power supply for this controller. It does not power the Motor.
            <br><b>•</b> the controller B+ post provides high power to the motor, B+ is not directly connected internally to this input.
            <br><b>•</b> This input will precharge internal high power circuits with limited current before allowing the Main solenoid to close.
            <br>
            <br><b>On:</b> battery voltage
            <br><b>Off:</b> no connection
            <br>Troubleshooting Notes:
            <br><b>Scroll right through harness connectors above to find your type</b>
            <br><b>1.</b> If this pin is not connected to the battery then the controller will not show up in the Bluetooth list. The App will always show Key On
            <br><b>2.</b> Verify the red led on the controller comes on for 1 second and then turns off when the key is turned on
            <br><b>3.</b> If there are any diagnostic errors the red led will flash a code which can be decoded with this App.
            <br><b>4.</b> Checking the vehicle harness:
            <br><b>a)</b> REMEBER TO TURN VEHICLE POWER OFF before connecting or disconnecting the harness (switch Key off)
            <br><b>b)</b> Disconnect the vehicle harness from the controller.
            <br><b>c)</b> With one side of a meter connected to the battery pack ground, measure that this pin on the vehicle harness has battery voltage when the key is switched to on and 0V when switched to off.
            <br><b>d)</b> if c) fails then verify with a meter that the other side of the key switch has battery voltage.

            Binding:PARPROFILENUMBER.enumListName(EZGO_TXT_440A_4kW_Navitas,EZGO_TXT_600A_5kW_Navitas,CLUB_CAR_400A_4kW_Navitas,CLUB_CAR_600A_5kW_Navitas)
            <b>Description:</b>(Images:TAC2_ClubCar_Precedent_EZGO_TXT.png,TAC2_EZGO_1268_Resistive_ITS.png,TAC2_TSX.png)(ImageOverlays:_key_run_charge.png)
             On this vehicle the key does not power this controller. The key is just a signal to the controller that the vehicle is enabled. The low current power supply for the controller comes from the Run/Tow switch under the seat.
            <br>
            <br><b>On:</b> battery voltage
            <br><b>Off:</b> no connection, pulled to 0V internally
            <br>
            <br>Troubleshooting Notes:
            <br><b>Scroll right through harness images above to find your type</b>
            <br><b>1.</b> If the dashboard green words indicate "waiting for the key switch" then this input is off and preventing the vehicle from driving.
            <br><b>2.</b> Checking the vehicle harness:
            <br><b>a)</b> REMEBER TO TURN VEHICLE POWER OFF before connecting or disconnecting the harness (switch to TOW)
            <br><b>b)</b> Disconnect the vehicle harness from the controller.
            <br><b>c)</b> With one side of a meter connected to the battery pack ground, measure that this pin on the vehicle harness has battery voltage when the key is switched to on and 0V when switched to off.
            <br><b>d)</b> if c) fails then verify with a meter that the other side of the key switch has battery voltage.

            Binding:PARPROFILENUMBER.enumListName(Yamaha_G29_440A_4kW_Navitas,Yamaha_G29_600A_4kW_Navitas)
            <b>Description:</b>(Images:TAC2_Yamaha_G29.png)(ImageOverlays:_key_run_charge.png)
             On this vehicle the key does not power this controller. The key is just a signal to the controller that the vehicle is enabled. The low current power supply for the controller comes from the Run/Tow switch under the seat.
            <br>
            <br><b>On:</b> battery voltage

            <br>

            <br><b>1.</b> If the dashboard green words indicate "waiting for the key switch" then this input is off and preventing the vehicle from driving.
            <br><b>2.</b> Checking the vehicle harness:
            <br><b>a)</b> REMEBER TO TURN VEHICLE POWER OFF before connecting or disconnecting the harness (switch to TOW)

            <br><b>d)</b> if c) fails then verify with a meter that the other side of the key switch has battery voltage.

        <Address>107</Address>
        <SubsetOfAddress>false</SubsetOfAddress>
        <Scale>1</Scale>
        <MemoryType>ReadOrWrite</MemoryType>
        <BitRangeStart>0</BitRangeStart>

        <MinimumParameterValue>0</MinimumParameterValue>

        <ImplementedFirmwareVersion>0.0</ImplementedFirmwareVersion>

        <enumListName>
            <string>Connected</string>
            <string>Not Connected</string>
        </enumListName>
        <Name>Charger Interlock</Name>
        <Description>
            <![CDATA[
            Binding:PARPROFILENUMBER.enumListName(EZGO_RXV_440A,EZGO_RXV_600A,EZGO_RXV2016_440A,EZGO_RXV2016_600A,RXV_ELITE_LITHIUM_600A)
            <b>Description:</b>(Images:TAC2_EZGO_RXV23.png,TAC2_EZGO_RXV35.png)(ImageOverlays:_key_run_charge.png)
             When charger interlock reads Connected, the vehicle will be inhibited from driving to not damage the charger port.
            The charger receptical has four wires inside:
            <br><b>•</b> battery+(red) and battery-(black) for actual charging
            <br><b>•</b> the blue wire goes to the controller for this signal
            <br><b>•</b> grey wire goes to battery+ as well for actual charger usage
            <br>
            <br><b>Charger Connected:</b> 0v (broken wire or receptical can always read as Connected because the signal is pulled to 0V internally)
            <br><b>Charger Not Connected:</b> battery voltage
            <br>Troubleshooting Notes:
            <br><b>1.</b> The App indicates it is waiting for the charger to be removed if this signal is preventing the vehicle from driving.
            <br><b>2.</b> make sure the blue and grey wires are connected properly
            <br><b>3.</b> Checking the vehicle harness:
            <br><b>a)</b> REMEBER TO TURN VEHICLE POWER OFF before connecting or disconnecting the harness
            <br><b>b)</b> Disconnect the vehicle harness from the controller.
            <br><b>c)</b> With one side of a meter connected to the battery pack ground, measure that this pin on the vehicle harness has battery voltage when charger is removed.
            <br><b>d)</b> if c) fails then verify with a meter that the charge port has has battery voltage.

            Binding:PARPROFILENUMBER.enumListName(EZGO_TXT_440A_4kW_Navitas,EZGO_TXT_600A_5kW_Navitas,CLUB_CAR_400A_4kW_Navitas,CLUB_CAR_600A_5kW_Navitas)
            <b>Description:</b>(Images:TAC2_ClubCar_Precedent_EZGO_TXT.png,TAC2_EZGO_1268_Resistive_ITS.png,TAC2_TSX.png)(ImageOverlays:_key_run_charge.png)
             When detected the vehicle will be inhibited from driving to not damage the charger port.
            The receptical has three wires inside:
            <br><b>•</b> battery+(red) and battery-(black) for actual charging
            <br><b>•</b> the third wire goes to the controller for this signal
            <br>
            <br><b>Charger Connected:</b> 0v (broken wire or receptical can always read as Connected because the signal is pulled to 0V internally)
            <br><b>Charger Not Connected:</b> battery voltage
            <br>Troubleshooting Notes:
            <br><b>1.</b> The App indicates it is waiting for the charger to be removed if this signal is preventing the vehicle from driving.
            <br><b>2.</b> make sure the 3 receptical wires are connected
            <br><b>3.</b> Checking the vehicle harness:
            <br><b>a)</b> REMEBER TO TURN VEHICLE POWER OFF before connecting or disconnecting the harness
            <br><b>b)</b> Disconnect the vehicle harness from the controller.
            <br><b>c)</b> With one side of a meter connected to the battery pack ground, measure that this pin on the vehicle harness has battery voltage when charger is removed.
            <br><b>d)</b> if c) fails then verify with a meter that the charge port has has battery voltage.

            Binding:PARPROFILENUMBER.enumListName(YDR2_440A,YDR2_600A,Yamaha_G29_440A_4kW_Navitas,Yamaha_G29_600A_4kW_Navitas)
            <b>Description:</b>Not connected to Yamaha proprietary charge communications port.
            ]]>
        </Description>

                <NestedEnumListName>

                <name>Run/Tow Input</name>
                <description>
                    <![CDATA[
              Binding:PARPROFILENUMBER.enumListName(EZGO_RXV_440A,EZGO_RXV_600A,EZGO_RXV2016_440A,EZGO_RXV2016_600A,RXV_ELITE_LITHIUM_600A)
            <b>Description:</b>(Images:TAC2_EZGO_RXV23.png,TAC2_EZGO_RXV35.png)(ImageOverlays:_key_run_charge.png)
             The run/tow switch when switched to tow, connects the battery voltage to this input. When switched to tow the controller will disengage the parking brake when the key is turned from off to on.
            <br><b>•</b> If for some reason this switch does not work, there are jumpers under the switch to force the brake to be disengaged without the controller being powered.
            <br>
            <br><b>Tow:</b> battery voltage
            <br><b>Run:</b> no connection, pulled to 0V internally
            <br>Troubleshooting Notes:
            <br><b>1.</b> If this pin is not connected, the App indicates the vehicle is in Tow and this signal is preventing the vehicle from driving.
            <br><b>2.</b> Checking the vehicle harness:
            <br><b>a)</b> REMEBER TO TURN VEHICLE POWER OFF before connecting or disconnecting the harness (switch key off)
            <br><b>b)</b> Disconnect the vehicle harness from the controller.
            <br><b>c)</b> With one side of a meter connected to the battery pack ground, measure that this pin on the vehicle harness has battery voltage when the run/tow is switched to tow and 0V when switched to run??????.
            <br><b>d)</b> if c) fails then verify with a meter that the other side of the run/tow  switch has battery voltage.

            Binding:PARPROFILENUMBER.enumListName(EZGO_TXT_440A_4kW_Navitas,EZGO_TXT_600A_5kW_Navitas,CLUB_CAR_400A_4kW_Navitas,CLUB_CAR_600A_5kW_Navitas)
            <b>Description:</b>(Images:TAC2_ClubCar_Precedent_EZGO_TXT.png,TAC2_EZGO_1268_Resistive_ITS.png,TAC2_TSX.png)(ImageOverlays:_key_run_charge.png)
             On this vehicle the run/tow switch is the low current power supply for this controller. When switched to RUN the controller is powered. When switched to tow the controller has no power (free to be towed).
            <br><b>•</b> the controller B+ post provides high power to the motor, B+ is not directly connected internally to this input.
            <br><b>•</b> This input will precharge internal high power circuits with limited current before allowing the Main solenoid to close.
            <br>
            <br><b>Run:</b> battery voltage
            <br><b>Tow:</b> no connection, no power
            <br>Troubleshooting Notes:
            <br><b>1.</b> If this pin is not connected to the battery then the controller will not show up in the Bluetooth list. The App will always show Run
            <br><b>2.</b> Verify the red led on the controller flashes on for 1 second and then turns off when the key is turned on.
            <br><b>3.</b> No led flash at power up may mean something is wrong with the vehicle harness.
            <br><b>4.</b> If there are any diagnostic errors the red led will flash a code which can be decoded with this App.
            <br><b>5.</b> Checking the vehicle harness:
            <br><b>a)</b> REMEBER TO TURN VEHICLE POWER OFF before connecting or disconnecting the harness (switch to Tow)
            <br><b>b)</b> Disconnect the vehicle harness from the controller.
            <br><b>c)</b> With one side of a meter connected to the battery pack ground, measure that this pin on the vehicle harness has battery voltage when the run/tow is switched to on and 0V when switched to off.
            <br><b>d)</b> if c) fails then verify with a meter that the other side of the key switch has battery voltage.

<script>
    if (typeof App.VehicleDiagnostics == 'undefined') App = {VehicleDiagnostics: new VehicleDiagnostics()};

    if (typeof HasBrowserCommandInterface != 'undefined')
    {
        App.NavitasMotorController = new NavitasMotorControllerModel(new CommunicationsInterface(new NavitasModbus())) //just so it looks like the c# NavitasBeta App.
    }
    else
    {
        App.NavitasMotorController = new NavitasMotorControllerModel(new CommunicationsInterface({})) //just so it looks like the c# NavitasBeta App.
    }

    window.addEventListener("unload", async function ()
    {
        App.NavitasMotorController.Communications.protocal.bEnableCommunicationTransmissions = false;
        console.log("Trying to Close ");
        if (typeof HasBrowserCommandInterface != 'undefined') App.NavitasMotorController.Communications.DeviceSocket.websocket.close();
    });

    // Without jQuery
    // Define a convenience method and use it
    let voltageScaleHtmlready = (callback) =>
    {
        //screen.orientation.addEventListener("change", callback);
        if (document.readyState != "loading") callback(); else document.addEventListener("DOMContentLoaded", callback);
    }
    // TODO: to add external loader with radarscan js
    var golfCartScanner = new RadarScan(document.getElementById("myCanvas"));
    var loadingText = document.querySelector(".loadingText");
    voltageScaleHtmlready(async () =>
    {
        console.log("DOM loaded");
        golfCartScanner.startRadarScan(1000 / 60); //frame rate = 60/s
        loadingText.innerHTML = "Step 1 of 3:<br>Checking for controller errors. Please wait...";
        await WaitForPhoneAppToStartThis(); //uncomment to run App0
    });

    var slideIndex = 1;

    function plusSlides(n)
    {
        callBackToTrapAndSetBreakpointsForExternallyLoadedJavascript();
        var instructionsSlides = document.getElementsByClassName("instructions-slide");
        if (n > 0)
        {
            instructionsSlides[slideIndex - 1].className += " left";
        }
        else if (n < 0)
        {
            instructionsSlides[slideIndex - 1].className += " right";
        }
        showSlides(slideIndex += n);
    }

    function showSlides(n)
    {
        var i;
        callBackToTrapAndSetBreakpointsForExternallyLoadedJavascript();
        var instructionsSlides = document.getElementsByClassName("instructions-slide");
        var dots = document.getElementsByClassName("dot");
        var instructionsSlideDescription = document.querySelector(".instructions-slide-description");
        if (n > instructionsSlides.length)
        {
            slideIndex = instructionsSlides.length;
        }
        if (n < 1)
        {
            slideIndex = 1
        }
        for (i = 0; i < dots.length; i++)
        {
            dots[i].className = dots[i].className.replace(" active", "");
        }
        instructionsSlides[slideIndex - 1].className = instructionsSlides[slideIndex - 1].className.replace(/(\sleft|\sright)/g, "")
        dots[slideIndex - 1].className += " active";
        instructionsSlideDescription.innerHTML = instructionsSlides[slideIndex - 1].firstElementChild.innerHTML;

        if (slideIndex == instructionsSlides.length)
        {
            document.querySelector(".formButton.revealAdjustScaleForm").style.visibility = "visible";
            document.querySelector(".slide-navigation.next").style.visibility = "hidden";
            document.querySelector(".slide-navigation.prev").style.visibility = "visible";
        }
        else
        {
            if (slideIndex == 1)
            {
                document.querySelector(".slide-navigation.prev").style.visibility = "hidden";
            }
            else
            {
                document.querySelector(".slide-navigation.prev").style.visibility = "visible";
            }
            document.querySelector(".slide-navigation.next").style.visibility = "visible";
            document.querySelector(".formButton.revealAdjustScaleForm").style.visibility = "hidden";
        }
    }

    var checkFaultsParams = {
        "GROUPONEFAULTS": [],
        "GROUPTWOFAULTS": [],
        "GROUPTHREEFAULTS": [],
        "GROUPFOURFAULTS": [],
        "VBATVDC": [],
        "Otp_dcbusScale": [],
        "LOGICSIDEBATTERYVOLTAGEV": [],
        "Otp_logicPowerScale": [],
    }
    var checkFaultsTimeoutId = 0;
    var faults = [];
    var initialSolenoidTestCompleted = false;

    async function initialSolenoidTest()
    {
        let pollingPeriod_ms = 10;
        let timeout_ms = 3000;
        await App.NavitasMotorController.JsonCommands({
            Read: {
                "Options": 0
            }
        });
        await App.NavitasMotorController.JsonCommands({
            Write: {
                "Options": App.NavitasMotorController.GetParameter("Options").parameterValue | (1 << 4),  // set bit 4 to 1 (enable manufacturing options)
            }
        });
        await App.VehicleDiagnostics.MainSolenoidSwitch(1);
        await Task.Delay(pollingPeriod_ms);
        let batteryVoltage = App.NavitasMotorController.GetParameter("VBATVDC").parameterValue;
        let logicVoltage = App.NavitasMotorController.GetParameter("LOGICSIDEBATTERYVOLTAGEV").parameterValue;
        while ((batteryVoltage < logicVoltage - 0.5) && (timeout_ms > 0))
        {
            await Task.Delay(pollingPeriod_ms);
            batteryVoltage = App.NavitasMotorController.GetParameter("VBATVDC").parameterValue;
            logicVoltage = App.NavitasMotorController.GetParameter("LOGICSIDEBATTERYVOLTAGEV").parameterValue;
            if ((timeout_ms -= pollingPeriod_ms) < 0)
            {
                console.log("Insufficient Bus Voltage check timeout");
            }
        }
        await App.NavitasMotorController.JsonCommands({
            Read: {
                "Options": 0
            }
        });
        await App.NavitasMotorController.JsonCommands({
            Write: {
                "Options": App.NavitasMotorController.GetParameter("Options").parameterValue & ~(1 << 4),  // set bit 4 to 0 (enable manufacturing options)
            }
        });
        await App.VehicleDiagnostics.MainSolenoidSwitch(0);
        if (batteryVoltage < logicVoltage - 0.5)
        {
            var fault = `Insufficient Bus Voltage:<br>The bus voltage is less than the battery voltage by more than 0.5V after the solenoid was closed. To resolve this issue, please check for any loose connections or burnt contacts, and consider replacing the solenoid.`;
            if (!faults.includes(fault)) faults.push(fault);
        }
        initialSolenoidTestCompleted = true;

        golfCartScanner.stopRadarScan();
    }

    async function checkFaults()
    {
        if ((App.NavitasMotorController.GetParameter("SOFTWAREREVISION").parameterValue < App.NavitasMotorController.GetParameter("Otp_dcbusScale").ImplementedFirmwareVersion))
        {
            var fault = `Please upgrade your firmware to use this feature (>= ${App.NavitasMotorController.GetParameter("Otp_dcbusScale").ImplementedFirmwareVersion}).`;
            if (!faults.includes(fault)) faults.push(fault);
        }

        for (const [key, value] of Object.entries(checkFaultsParams))
        {
            var keyParam = App.NavitasMotorController.GetParameter(key);
            value.forEach((param) =>
            {
                var p = App.NavitasMotorController.GetParameter(param);
                if ((keyParam.parameterValue & (1 << p.BitRangeStart)) !== 0 && !faults.includes(p.Name))
                {
                    faults.push(`${p.Name}`);
                }
                else if ((keyParam.parameterValue & (1 << p.BitRangeStart)) === 0 && faults.includes(p.Name))
                {
                    faults.splice(faults.indexOf(p.Name), 1);
                }
            })
        }

        if (faults.length === 0 && !initialSolenoidTestCompleted)
        {
            loadingText.innerHTML = "Step 1 of 3:<br>The initial test is in progress. Please wait...";
            await initialSolenoidTest();
        }
        displayErrors();

        while (formAcceptFunctionRunning)
        {
            await Task.Delay(50);
        }
        checkFaultsTimeoutId = setTimeout(checkFaults, 15);
    }

    var bar1ProgressPercentage2 = 0;
    var revealProgressCircleTimeoutId = 0;

    function revealProgressCircle(text, reveal = false)
    {
        var progressCircle = document.querySelector(".progressCircle");
        if (reveal)
        {
            clearTimeout(revealProgressCircleTimeoutId);
            progressCircle.style.display = "block";
            bar1ProgressPercentage2 = progressBar(document.querySelector(".progressCircle"), 101 + bar1ProgressPercentage2, "", "", 100, '#e7f2ba', text) + 4;
            revealProgressCircleTimeoutId = setTimeout(() =>
            {
                revealProgressCircle(text, true)
            }, 100);
        }
        else
        {
            clearTimeout(revealProgressCircleTimeoutId);
            progressCircle.style.display = "none";
        }
    }

    async function revealAdjustScaleForm(reveal = false)
    {
        var submain = document.querySelector(".submain");
        if (reveal)
        {
            revealProgressCircle('Closing solenoid', true);
            // await App.VehicleDiagnostics.SetOutputState(App.NavitasMotorController.GetParameter("MAINCTROUTPUT").BitRangeStart, 1);
            await App.NavitasMotorController.JsonCommands({
                Read: {
                    "Options": 0
                }
            });
            await App.VehicleDiagnostics.MainSolenoidSwitch(1);
            await App.NavitasMotorController.JsonCommands({
                Write: {
                    "Options": App.NavitasMotorController.GetParameter("Options").parameterValue | (1 << 4),  // set bit 4 to 1 (enable manufacturing options)
                }
            });
            // await App.VehicleDiagnostics.SetManufacturingOptions(App.NavitasMotorController.GetParameter("MANUFACTURINGTESTOPTION").BitRangeStart, 1);
            // await App.VehicleDiagnostics.SetManufacturingOptions(1);
            Array.from(submain.children).forEach(element => {
                if (element.classList.contains("adjustScaleForm")) {
                    element.classList.add("enabled");
                    element.firstElementChild.focus();
                }
                else
                {
                    element.classList.remove("enabled");
                }
            });
            submain.classList.add("enabled");
            revealProgressCircle('');
        }
        else
        {
            revealProgressCircle('Opening solenoid', true);
            // await App.VehicleDiagnostics.SetOutputState(App.NavitasMotorController.GetParameter("MAINCTROUTPUT").BitRangeStart, 0);
            await App.NavitasMotorController.JsonCommands({
                Read: {
                    "Options": 0
                }
            });
            await App.VehicleDiagnostics.MainSolenoidSwitch(0);
            await App.NavitasMotorController.JsonCommands({
                Write: {
                    "Options": App.NavitasMotorController.GetParameter("Options").parameterValue & ~(1 << 4),  // set bit 4 to 0 (enable manufacturing options)
                }
            });
            // await App.VehicleDiagnostics.SetManufacturingOptions(App.NavitasMotorController.GetParameter("MANUFACTURINGTESTOPTION").BitRangeStart, 0);
            // await App.VehicleDiagnostics.SetManufacturingOptions(0);
            Array.from(submain.children).forEach(element => {
                if (element.classList.contains("adjustScaleForm")) {
                    element.classList.remove("enabled");
                }
            });
            submain.classList.remove("enabled");
            revealProgressCircle('');
        }
    }

    var disableAdjustScaleLoading = false;

    function displayErrors()
    {
        var warningText = document.querySelector(".adjustScaleError > .warningText");
        warningText.innerHTML = `Before continuing with voltage scale calibration, please address the following error(s):<br><ul>${faults.reduce((acc, fault) =>
        {
            return `${acc}<li>${fault}</li>`;
        }, '')}</ul><br>After closing this popup, if the warning error icon is displayed, please click on it to find more details.`

        var adjustScaleDisable = document.getElementsByClassName("adjustScaleDisable");
        Array.from(adjustScaleDisable).forEach(element =>
        {
            if (faults.length > 0)
            {
                loadingText.innerHTML = "Step 1 of 3:<br>Test failed!";
                document.querySelector(".adjustScaleLoading > .adjustScaleFormButtons").style.display = "none";

                if (element.className.includes("adjustScaleError"))
                {
                    element.disabled = false;
                    element.style.display = "block";
                }
                else
                {
                    element.style.display = "none";
                    element.disabled = true;
                }
            }
            else
            {
                loadingText.innerHTML = "Step 1 of 3:<br>Test passed!";
                document.querySelector(".adjustScaleLoading > .adjustScaleFormButtons").style.display = "block";
            }
        });
    }

    function revealAdjustScaleInstructions(reveal = false)
    {
        if (reveal)
        {
            var adjustScaleDisable = document.getElementsByClassName("adjustScaleDisable");
            Array.from(adjustScaleDisable).forEach(element =>
            {
                if (element.className.includes("adjustScaleInstructions"))
                {
                    showSlides(slideIndex);
                    element.disabled = false;
                    element.style.display = "block";
                }
                else
                {
                    element.style.display = "none";
                    element.disabled = true;
                }
            });
        }
    }

    async function revealAdjustScaleFormConfirmation(text, reveal = false)
    {
        var adjustScaleFormConfirmation = document.querySelector(".adjustScaleFormConfirmation");
        adjustScaleFormConfirmation.firstElementChild.innerHTML = text;
        var submain = document.querySelector(".submain");
        if (reveal)
        {
            Array.from(submain.children).forEach(element =>
            {
                if (element.classList.contains("adjustScaleFormConfirmation"))
                {
                    element.classList.add("enabled");
                }
                else
                {
                    element.classList.remove("enabled");
                }
            });
            submain.classList.add("enabled");
        }
        else
        {
            await revealAdjustScaleForm();
            Array.from(submain.children).forEach(element =>
            {
                if (element.classList.contains("adjustScaleFormConfirmation"))
                {
                    element.classList.remove("enabled");
                }
            });
            submain.classList.remove("enabled");
        }
    }

    async function revealAdjustScaleFormWarning(text, reveal = false)
    {
        var adjustScaleFormWarning = document.querySelector(".adjustScaleFormWarning");
        adjustScaleFormWarning.firstElementChild.innerHTML = text;
        var submain = document.querySelector(".submain");
        if (reveal)
        {
            Array.from(submain.children).forEach(element =>
            {
                if (element.classList.contains("adjustScaleFormWarning"))
                {
                    element.classList.add("enabled");
                }
                else
                {
                    element.classList.remove("enabled");
                }
            });
            submain.classList.add("enabled");
        }
        else
        {
            await revealAdjustScaleForm();
            Array.from(submain.children).forEach(element =>
            {
                element.classList.remove("enabled");
            });
            submain.classList.remove("enabled");
        }
    }

    var formAcceptFunctionRunning = false;

    async function formAccept()
    {
        formAcceptFunctionRunning = true;
        revealProgressCircle('Saving...', true);
        var adjustScaleFormInput = document.querySelector(".adjustScaleFormInput");
        var adjustScaleFormInputValue = parseFloat(adjustScaleFormInput.value);
        var value = parseFloat((adjustScaleFormInputValue / (App.NavitasMotorController.GetParameter("VBATVDC").parameterValue / App.NavitasMotorController.GetParameter("Otp_dcbusScale").parameterValue)).toFixed(2));
        await App.NavitasMotorController.JsonCommands({
            Write: {
                "Otp_dcbusScale": value
            }
        });
        value = adjustScaleFormInputValue / (App.NavitasMotorController.GetParameter("LOGICSIDEBATTERYVOLTAGEV").parameterValue / App.NavitasMotorController.GetParameter("Otp_logicPowerScale").parameterValue);
        await App.NavitasMotorController.JsonCommands({
            Write: {
                "Otp_logicPowerScale": value
            }
        });
        await App.NavitasMotorController.JsonCommands({
            Write: {
                "SAVEPARAMS": 1
            }
        });
        document.querySelector(".revealAdjustScaleForm").innerHTML = "Recalibrate";

        revealProgressCircle('');
        document.querySelector(".adjustScaleInstructions > .adjustScaleFormButtons > .close").innerHTML = "Close";
        document.querySelector(".instructions-slide-description").innerHTML = "Calibration saved.";
        await revealAdjustScaleFormWarning('', false);
        formAcceptFunctionRunning = false;
    }


    async function formSubmit()
    {
        var adjustScaleFormInput = document.querySelector(".adjustScaleFormInput");
        var adjustScaleFormInputValue = parseFloat(adjustScaleFormInput.value);
        var minValue = 0.95;
        var maxValue = 1.05;
        var value = adjustScaleFormInputValue / (App.NavitasMotorController.GetParameter("VBATVDC").parameterValue / App.NavitasMotorController.GetParameter("Otp_dcbusScale").parameterValue);
        var valueTwoDecimals = value.toFixed(2);
        if (valueTwoDecimals >= minValue && valueTwoDecimals <= maxValue)
        {
            // revealAdjustScaleForm(false);
            var oldBatteryVoltage = App.NavitasMotorController.GetParameter("VBATVDC").parameterValue.toFixed(2)
            var newBatteryVoltage = (value / (App.NavitasMotorController.GetParameter("Otp_dcbusScale").parameterValue / App.NavitasMotorController.GetParameter("VBATVDC").parameterValue)).toFixed(2);
            var text = `Old battery voltage: ${oldBatteryVoltage}V<br>New battery voltage: ${newBatteryVoltage}V`;
            if (Math.abs(newBatteryVoltage - oldBatteryVoltage) < 0.02)
            {
                text += `<br>The new battery voltage shows a difference of less than 0.02V.<br>Would you like to proceed?`
            }
            await revealAdjustScaleFormConfirmation(text, true);
        }
        else
        {
            // revealAdjustScaleForm(false);
            var text = "The value entered deviated more than 5% from controller reference value.<br>Please recheck your meter or your measurement. ";
            await revealAdjustScaleFormWarning(text, true);
        }
    }

    let voltageScaleHtmlSimulationCheckTimeout = 80;

    async function WaitForPhoneAppToStartThis()
    {
        //if this is running in the actual Phone App then the App will inject a function called invokeCSharpAction()
        //so give it a couple seconds to do that (should only take 100ms)
        //startDiagnoseHtmlSimulationCheckTimeout = 0;
        if (typeof HasBrowserCommandInterface != 'undefined')
        { //This must be running from a browser
            //RG Nov 27, Something has to be done here if simulating
            invokeSimulatedActionIsEnabled = false;
            console.log("Browser detected");
            App.NavitasMotorController.CommandHandler = new BrowserCommandInterface(App.NavitasMotorController);
            App.NavitasMotorController.Communications.protocal.bEnableCommunicationTransmissions = true;
            await App.NavitasMotorController.Communications.BeginThread();
            while (App.NavitasMotorController.ModelType == "")
                await Task.Delay(500);
            await BuildHTML();
            checkFaults();
            TestStateMachine();
        }
        else if (typeof invokeCSharpAction == 'function') //This must be running from the Phone App
        {
            invokeSimulatedActionIsEnabled = false;
            console.log("Phone app detected");
            await App.NavitasMotorController.JsonCommands({GetAppParameters: {}}); //will update things like App.NavitasMotorController.ModelType
            while (App.NavitasMotorController.ModelType == "") await Task.Delay(500);
            await BuildHTML();
            checkFaults();
            TestStateMachine();
        }
        else
        {
            if (voltageScaleHtmlSimulationCheckTimeout == 0)
            {
                invokeSimulatedActionIsEnabled = true;
                console.log("Simulation detected");
                App.NavitasMotorController.Model = "TAC";
                App.SimulatedMotorController = new NavitasMotorControllerModel(new CommunicationsInterface({}));
                App.SimulatedMotorController.Model = "TAC";
                App.NavitasMotorController.CommandHandler = new SimulatedCommandInterface(App.NavitasMotorController, App.SimulatedMotorController);
                await BuildHTML();
                checkFaults();
                TestStateMachine();
            }
            else
            {
                voltageScaleHtmlSimulationCheckTimeout -= 1;
                setTimeout(WaitForPhoneAppToStartThis, 100);
            }
        }
    }

    function UpdateElementInnerHTML(e)
    {
        var element = document.querySelector(`#${e.currentTarget.PropertyName}-value`);
        var elementAttributes = element.className.split(" ").reduce((acc, curr) =>
        {
            const [key, value] = curr.split("=");
            acc[key] = parseFloat(value) ? parseFloat(value) : value;
            return acc;
        }, {});
        var value = e.currentTarget.parameterValue;
        if (elementAttributes["scale"]) value = parseFloat(value) * elementAttributes["scale"];
        if (elementAttributes["decimal"]) value = value.toFixed(elementAttributes["decimal"]);
        if (elementAttributes["concat"]) value = value + elementAttributes["concat"];
        element.innerHTML = value;
    }

    var readParam = {};
    var startX, startY, endX, endY;

    async function BuildHTML()
    {
        await App.NavitasMotorController.JsonCommands({
            Read: {
                "SOFTWAREREVISION": 0
            }
        });

        var closeButtons = document.getElementsByClassName("close");
        Array.from(closeButtons).forEach(element => element.addEventListener("click", () =>
        {
            App.NavitasMotorController.JsonCommands({Close: null});
        }));
        var prevButton = document.querySelector(".prev");
        prevButton.onclick = () =>
        {
            prevButton.blur();
            plusSlides(-1);
        };
        var nextButton = document.querySelector(".next");
        nextButton.onclick = () =>
        {
            nextButton.blur();
            plusSlides(1);
        }

        var adjustScaleForm = document.querySelector(".adjustScaleForm");
        adjustScaleForm.firstElementChild.addEventListener('focus', () =>
        {
            window.scrollTo(adjustScaleForm.offsetLeft, adjustScaleForm.offsetTop + adjustScaleForm.offsetHeight);
        });
        callBackToTrapAndSetBreakpointsForExternallyLoadedJavascript();
        var instructionsSlides = document.getElementsByClassName("instructions-slide");
        Array.from(instructionsSlides).forEach(element => element.addEventListener('touchstart', (event) =>
        {
            startX = event.touches[0].clientX;
            startY = event.touches[0].clientY;
        }));
        Array.from(instructionsSlides).forEach(element => element.addEventListener('touchmove', (event) =>
        {
            endY = event.changedTouches[0].clientY;

            const diffY = endY - startY;

            if (Math.abs(diffY) < 50)
            {  // Vertical swipe
                event.preventDefault();
            }
        }));
        Array.from(instructionsSlides).forEach(element => element.addEventListener('touchend', (event) =>
        {
            endX = event.changedTouches[0].clientX;
            endY = event.changedTouches[0].clientY;

            const diffX = endX - startX;
            const diffY = endY - startY;

            if (Math.abs(diffX) > Math.abs(diffY))
            { // Horizontal swipe
                if (diffX > 0)
                { // Right swipe
                    prevButton.blur();
                    plusSlides(-1);
                }
                else
                { // Left swipe
                    nextButton.blur();
                    plusSlides(1);
                }
            }
            else
            { // Vertical swipe
                if (diffY > 0)
                {
                    // Down swipe
                }
                else
                {
                    // Up swipe
                }
            }
        }));

        var i;
        var params = document.getElementsByClassName("readParam");
        for (i = 0; i < params.length; i++)
        {
            var paramPropertyName = params[i].id.split("-")[0];
            params[i].previousElementSibling.innerHTML = App.NavitasMotorController.GetParameter(paramPropertyName).Name + ":";
            App.NavitasMotorController.GetParameter(paramPropertyName).addEventListener("PropertyChanged", UpdateElementInnerHTML, false);
            readParam[`${paramPropertyName}`] = 0;
        }
        for (const [key, value] of Object.entries(checkFaultsParams))
        {
            readParam[`${key}`] = 0;
        }
    }

    var testStateMachineTimeoutId = 0;
    async function TestStateMachine()
    {
        await App.NavitasMotorController.JsonCommands({
            Read: readParam
        });

        while (formAcceptFunctionRunning)
        {
            await Task.Delay(50);
        }
        testStateMachineTimeoutId = setTimeout(TestStateMachine, 15);
    }
</script>
</body>
</html>
